import PropTypes from 'prop-types';
import React from 'react';
import {Col, Button, Form, FormGroup, Input } from 'reactstrap';
import { Field, reduxForm } from 'redux-form';


const validate = values => {
  const errors = {}
  if (!values.name) {
    errors.name = 'Required'
  } else if (values.name.length < 2) {
    errors.name = 'Minimum be 2 characters or more'
  }
  if (!values.roomno) {
    errors.roomno = 'Required'
  }
  if (!values.dob) {
    errors.dob = 'Required'
  }
  return errors
  }
let RequestForm = props => {
    const {      
        // usernameLabel,
        handleSubmit,
        usernameInputProps,
        roomnoInputProps,
        dobInputProps
    } = this.props
    return(
            <Col className="form-main">
              <Form onSubmit={handleSubmit} >
                    <FormGroup>
                        {/* <Label for={usernameLabel}>{usernameLabel}</Label> */}
                        <Input {...usernameInputProps} className="input-bgColor"/>
                    </FormGroup>
                    <FormGroup>

                        <Input {...roomnoInputProps} className="input-bgColor" />
                    </FormGroup>
                    <FormGroup>

                        <Input {...dobInputProps} className="input-bgColor"/>
                    </FormGroup>


                    <Button
                        size="lg"
                        className="Requestbtn bg-gradient-Requestbtn btn-outline-info border-0"
                        block
                        >
                            REQUEST ACCESS
                    </Button>

              </Form>
              </Col>

    );
  }

RequestForm.propTypes = {
    // usernameLabel: PropTypes.string,
    usernameInputProps: PropTypes.object,
    roomnoInputProps: PropTypes.object,
    dobInputProps: PropTypes.object
}


RequestForm.defaultProps = {
    usernameLabel: 'Bansal',
    usernameInputProps: {
      type: 'text',
      placeholder: 'Name',
    },
   roomnoLabel: 'Name',
   roomnoInputProps: {
      type: 'text',
      placeholder: 'Room No',
    },
   dobLabel: 'Date of Birth',
   dobInputProps: {
      type: 'text',
      placeholder: 'Date of Birth',
    },
};

export default RequestForm;
